import React from 'react';

function VideoCounter({ videos }) {
  const totalVideos = videos.length;
  const watchedVideos = videos.filter((video) => video.watched).length;
  const unwatchedVideos = totalVideos - watchedVideos;

  return (
    <div>
      <p>Nombre de vidéos totales : {totalVideos}</p>
      <p>Nombre de vidéos regardées : {watchedVideos}</p>
      <p>Nombre de vidéos non regardées : {unwatchedVideos}</p>
    </div>
  );
}

export default VideoCounter;
